import styled from 'styled-components'

export const Section = styled.section`
  max-height: 604px;
  background-image: linear-gradient(to right,  #0084D7, #0266A5);
`

export const Home1 = styled.section `
  display: flex;
  img {
    max-width: 100%;
    max-height: 100%;
    padding-top: 3%;
    padding-left: 10%;
    padding-right: 10%;
  }
  p {
    font-family: 'Raleway', sans-serif;
    font-size: 23px;
    font-weight: 600;
    padding-top: 15%;
    width: 480px;
    color: #fff;
  }
`

